INSERT INTO "PUBLIC"."Contido" VALUES
(1, 12, U&'El Dador (en el ingl\00e9s original, The Giver) es una novela escrita por la autora estadounidense Lois Lowry. Est\00e1 ambientada en una sociedad futurista que es presentada, primero, como una sociedad ut\00f3pica; pero, gradualmente, parece ser m\00e1s bien una dist\00f3pica.'),
(2, 12, U&'Magn\00edfica historia que nos presenta a un joven, Jon\00e1s, que vive en una Comunidad totalmente controlada y donde todos sus miembros tienen un papel asignado por el Comit\00e9 de Ancianos, m\00e1ximo organismo de mando. Sus habitantes no sufren, ni carecen de nada, pero, a cambio, est\00e1n privados de libertad. Jon\00e1s, un joven de doce a\00f1os, recibe en la Ceremonia del Doce, la misi\00f3n m\00e1s relevante dentro de la Comunidad: Jon\00e1s ser\00e1 el encargado de sustituir a un anciano cuya funci\00f3n es la de mantener los recuerdos de la Comunidad. El anciano, "El Dador", empieza a transmitir a Jon\00e1s los recuerdos que \00e9l posee. Al principio Jon\00e1s adquiere sensaciones sencillas como el color, el sol, la nieve, las monta\00f1as... Para despu\00e9s entrar en contacto con el amor, la guerra, la muerte... Estas nuevas experiencias, le har\00e1n plantearse muchas actitudes consideradas normales dentro de la Comunidad y a dudar de s\00ed para evitar el sufrimiento y la tristeza renunciando al amor y la libertad. En esta clase de relatos de ficci\00f3n dirigido a j\00f3venes, se proponen problemas muy humanos: la libertad, la esclavitud, la felicidad, el respeto a la vida. El protagonista, con decisi\00f3n y valent\00eda, sabe salir del cerco que le tiende la Comunidad. Detr\00e1s de la monta\00f1a le espera una vida diferente.'),
(3, 12, U&'Lois Lowry naci\00f3 en Honolulu, Hawai, EE.UU. Estudi\00f3 en la Universidad de Maine. Ha vivido en distintas partes del mundo. Comenz\00f3 su carrera como fot\00f3grafa y periodista independiente en la d\00e9cada de 1970. Su trabajo llam\00f3 la atenci\00f3n de Houghton Mifflin, que la anim\00f3 a escribir su primer libro infantil. Su primera obra, A Summer to Die, fue publicada en 1977. Desde entonces ha escrito m\00e1s de 30 libros para ni\00f1os y ha publicado una autobiograf\00eda. Dos de sus libros han sido galardonados con el premio Newbery: N\00famero de las estrellas, en 1990, y El dador, en 1993.'),
(4, 13, U&'Ariel es el \00faltimo poemario de Sylvia Plath. Se public\00f3 p\00f3stumamente en 1965. Contiene algunos de sus poemas m\00e1s famosos, Daddy y Lady Lazarus.'),
(5, 13, U&'Sylvia Plath (Boston, 1932 - Londres, 1963). Escritora estadounidense especialmente conocida como poeta, aunque tambi\00e9n es autora de obras en prosa, como la novela semi-autobiogr\00e1fica, "La campana de cristal" (bajo el pseud\00f3nimo de Victoria Lucas), as\00ed como de relatos y ensayos. Junto con Anne Sexton, Plath es considerada una de las principales cultivadoras del g\00e9nero de la poes\00eda confesional, iniciado por Robert Lowell y W. D. Snodgrass. Se suicid\00f3 en 1963. Tras su muerte, su marido, el tambi\00e9n poeta Ted Hughes, se encarg\00f3 de la edici\00f3n de su poes\00eda completa.'),
(6, 13, U&'\00abLos poemas de Sylvia Plath ya han pasado a la leyenda como representantes del \00e1nimo de nuestra \00e9poca, y son \00fanicos en su brillo implacable\00bb. George Steiner'),
(7, 13, U&'Publicado p\00f3stumamente en 1964, este es el \00faltimo poemario de Sylvia Plath y lleg\00f3 envuelto en una cierta pol\00e9mica, pues su marido, Ted Hughes, edit\00f3 el manuscrito original suprimiendo o a\00f1adiendo algunos poemas. Esto dividi\00f3 a la cr\00edtica entre los que lo consideraban una intromisi\00f3n y los que entend\00edan que Hughes y Plath sol\00edan colaborar. Finalmente, en 2004, sali\00f3 a la luz la edici\00f3n \00edntegra de Ariel que ahora presentamos, con la selecci\00f3n y organizaci\00f3n original de los poemas, en edici\00f3n ilustrada. Esta obra es una brillante muestra del estilo po\00e9tico de la gran escritora estadounidense, de versos alternativamente brutales y suaves, cortantes y acariciadores.'),
(8, 13, U&'Este poemario suscit\00f3 mucha controversia entre la comunidad feminista. En el momento de su suicidio en 1963, Sylvia Plath dejaba un manuscrito pr\00e1cticamente acabado, titulado Ariel y otros poemas. La primera edici\00f3n publicada es parecida a este manuscrito, pero no igual, Ted Hughes, marido y albacea literario de Sylvia, quit\00f3 algunos poemas para evitar que su obra pareciera manida y repetitiva. Algunos cr\00edticos consideraron esto una intromisi\00f3n a la voluntad de Sylvia Plath, para otros no era tal ya que, Ted Hughes y Sylvia Plath ten\00edan por costumbre ayudarse a finiquitar las obras de ambos.');     
