CREATE USER IF NOT EXISTS "" SALT '' HASH '' ADMIN;            
CREATE CACHED TABLE "PUBLIC"."Book"(
    "idBook" INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1 RESTART WITH 14) NOT NULL,
    "isbn" CHARACTER VARYING(13) NOT NULL,
    "titulo" CHARACTER VARYING(255) NOT NULL,
    "autor" CHARACTER VARYING(255),
    "anho" INTEGER,
    "disponible" BOOLEAN DEFAULT TRUE,
    "portada" BINARY LARGE OBJECT
);
ALTER TABLE "PUBLIC"."Book" ADD CONSTRAINT "PUBLIC"."BOOK_PK" PRIMARY KEY("idBook");           
-- 13 +/- SELECT COUNT(*) FROM PUBLIC.Book;    
CREATE CACHED LOCAL TEMPORARY TABLE IF NOT EXISTS SYSTEM_LOB_STREAM(ID INT NOT NULL, PART INT NOT NULL, CDATA VARCHAR, BDATA VARBINARY);       
ALTER TABLE SYSTEM_LOB_STREAM ADD CONSTRAINT SYSTEM_LOB_STREAM_PRIMARY_KEY PRIMARY KEY(ID, PART);              
CREATE ALIAS IF NOT EXISTS SYSTEM_COMBINE_CLOB FOR 'org.h2.command.dml.ScriptCommand.combineClob';             
CREATE ALIAS IF NOT EXISTS SYSTEM_COMBINE_BLOB FOR 'org.h2.command.dml.ScriptCommand.combineBlob';             
CREATE INDEX "PUBLIC"."IdxBookISBN" ON "PUBLIC"."Book"("isbn" NULLS FIRST);    
CREATE INDEX "PUBLIC"."IdxBookTitle" ON "PUBLIC"."Book"("titulo" NULLS FIRST); 
CREATE UNIQUE INDEX "PUBLIC"."IdBookPK" ON "PUBLIC"."Book"("idBook" NULLS FIRST);              
CREATE CACHED TABLE "PUBLIC"."Contido"(
    "idContido" INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1 RESTART WITH 9) NOT NULL,
    "idBook" INTEGER NOT NULL,
    "contido" CHARACTER LARGE OBJECT
); 
ALTER TABLE "PUBLIC"."Contido" ADD CONSTRAINT "PUBLIC"."Contido_PK" PRIMARY KEY("idContido");  
