DROP TABLE IF EXISTS SYSTEM_LOB_STREAM;        
DROP ALIAS IF EXISTS SYSTEM_COMBINE_CLOB;      
DROP ALIAS IF EXISTS SYSTEM_COMBINE_BLOB;      
ALTER TABLE "PUBLIC"."Contido" ADD CONSTRAINT "PUBLIC"."FK_ID_BOOK" FOREIGN KEY("idBook") REFERENCES "PUBLIC"."Book"("idBook") ON DELETE CASCADE ON UPDATE CASCADE NOCHECK;    
